import React from "react";
import "./blogs.css";
import { Blogdata } from "../../Appdata";

const Blogs = () => {
  return (
    <>
      <div className="blog-container" id="blog">
        <div className="blog-head">
          <div className="blog-head-left">
            <div className="box">
              <div className="bar"></div>
              <span>{Blogdata[0].span}</span>
            </div>
            <h2>
              {Blogdata[0].BlogHeading} <span>{Blogdata[0].HeadingSpan}</span>
            </h2>
          </div>
          <div className="blog-head-right">
            <button className="primary-btn discover">{Blogdata[0].Btn}</button>
          </div>
        </div>
        <div className="blog-card-container">
          <BlogCard
            BlogImg={Blogdata[0].BlogImg1}
            BlogTopic={"Graphics"}
            // DateImg={DateImg}
            date={"August 21, 2023"}
            BlogHeading={"Popular consultants are big meetup 2022"}
            // PubImg={PubImg}
            PubName={"Julia Moris"}
          />
        </div>
      </div>
    </>
  );
};
export default Blogs;

function BlogCard(props) {
  return (
    <>
      <div className="blog-card">
        <img src={props.BlogImg} alt="" />
        <div className="blog-topic">{props.BlogTopic}</div>
        <div className="date">
          <img src={props.DateImg} alt="" />
          <span>{props.date}</span>
        </div>
        <div className="blog-heading">
          <h3>{props.BlogHeading}</h3>
        </div>
        <div className="blog-card-footer">
          <div className="publisher">
            <img src={props.PubImg} alt="" />
            <span>{props.PubName}</span>
          </div>
          <div className="read-more">
            <a href="https://www.youtube.com/">
              Read More <span>+</span>
            </a>
          </div>
        </div>
      </div>
    </>
  );
}
